import{_ as e,c as s,o as r,a4 as t}from"./chunks/framework.CGkmJMTS.js";const a="data:image/png;base64,",i="/VitePress/assets/item2.CqU1FKyV.png",n="/VitePress/assets/item3.B5IqduO2.png",A="/VitePress/assets/item4.BO5qZzpJ.png",o="/VitePress/assets/item5.CRLGYxXG.png",h="/VitePress/assets/item6.CQgAWZzc.png",p="/VitePress/assets/item7.PdfT9DlW.png",l="/VitePress/assets/item8.F0ZS9YRJ.png",m="/VitePress/assets/item9.BDcofhAj.png",c="data:image/png;base64,",z=JSON.parse('{"title":"概述","description":"","frontmatter":{},"headers":[],"relativePath":"workLeisure/list.md","filePath":"workLeisure/list.md"}'),f={name:"workLeisure/list.md"},P=t('<h1 id="概述" tabindex="-1">概述 <a class="header-anchor" href="#概述" aria-label="Permalink to &quot;概述&quot;">​</a></h1><p>这里记录一下工作中遇到的令人迷惑的事</p><h2 id="复杂的样式污染" tabindex="-1">复杂的样式污染 <a class="header-anchor" href="#复杂的样式污染" aria-label="Permalink to &quot;复杂的样式污染&quot;">​</a></h2><p>那是一个阳光明媚的午后，我接到一条平平无奇的需求，<strong>把输入框和底下提示的间距调一下</strong></p><hr><p><img src="'+a+'" alt=""></p><hr><p>我的内心毫无波澜，打开 VSCode，稍微感到了一丝不对劲</p><hr><p><img src="'+i+'" alt=""></p><hr><p>class 名称居然是 aaaa，这比我之前遇到的 aa 还要强大一个等级啊，还有行内样式，呵，看来这次的需求不简单啊，我打开控制台准备大干一场，按下 F12，瞬间控制台上一连串的符咒好似魔法一般闪的我睁不开眼</p><hr><p><img src="'+n+'" alt=""></p><hr><blockquote><p>这里没有截完，下面都是这样的</p></blockquote><p>什么！？居然是覆盖组件样式，还是多重的，真是可怕，写下这代码的人功力真是深厚，我眉头微微一皱，暗道不简单，首先这是覆盖了 el-form-item<strong>content 的样式，那么这个页面上所有的 el-form-item 都将会受到影响，最坏的情况下，此人如果不使用 scoped 关键字，这样的覆盖将会扩散到全局，也就是整个项目的表单都会受到影响， 但是没关系，这个需求应当只需要修改 el-form-item</strong>error 的样式即可，我的鼠标缓缓移向红色的错误提示，然后点击</p><hr><p><img src="'+A+'" alt=""></p><hr><p>瞬间，大量的!important 进入我的意识，可恶，快处理不过来了，我拿起水杯喝了一口水，嘶，真是恐怖如斯，在这平平无奇之地，居然有人能布下这样的禁制，真是大意了，我总算回过神来，开始研究这段样式，啧啧啧，真是天才，天才啊，这世间竟有如此奇人，不光光重现了之前的多重样式覆盖，竟然还加上了!important 这样的陷阱，可恶，现在我要开始认真了，等等，我方才竟然忽略了一件事，只有 display 不为 inherit 的才可以设置 top 属性，难道他，难道他竟将表单元素设置为了绝对定位，啧啧，用天才已经难以形容这种人物了，简直是绝世鬼才</p><p>我冷静了一下，理清思路，首先我们需要取消绝对定位，因为这会影响 element 自身的样式，然后将奇奇怪怪的属性全部去掉，是的就是这么简单，element 本身就以简洁闻名，只需要少量设置，就能达到很不错的效果。但有一点致命问题，这样式也牵涉到其他的页面，修改一个的同时很有可能触动到其他页面</p><hr><p><img src="'+o+'" alt=""></p><hr><p>果然如此，看来是有 10 个页面没有使用 scoped 导致样式全部混到一起，这样的话工作量就相当庞大了，特别是这个项目目前处于刚刚上线运行期间，此时可能会有其他更重要的需求要解决，而这个样式的修改一旦开始就没法停下，如果改到一半就停下，受影响的页面会变得一团糟，工作量完全没法预估，该死，我一世英明，竟栽在这种鬼才手中，而且，想要修改提示，势必要修改表单的高度，这又是一场恶战，并且，如果删除这该死的全局样式，不知有多少页面会受到影响，又有多少修改的工作量啊</p><h2 id="上线的项目还有未完成的功能" tabindex="-1">上线的项目还有未完成的功能？？ <a class="header-anchor" href="#上线的项目还有未完成的功能" aria-label="Permalink to &quot;上线的项目还有未完成的功能？？&quot;">​</a></h2><h3 id="废话环节" tabindex="-1">废话环节 <a class="header-anchor" href="#废话环节" aria-label="Permalink to &quot;废话环节&quot;">​</a></h3><p>嗨海害，又到了今日的迷惑行为分析环节，话说鼠鼠我啊，终于也要经历项目上线了呢，本来以为上线那段时间会有很多问题，但其实并没有(<s>说不定客户用都不想用</s>)，然后鼠鼠的主管看鼠鼠太闲，拉了个同事测试了下项目，然后出来了一些问题，然后今天的主角就是其中的一个问题。</p><h3 id="概述-1" tabindex="-1">概述 <a class="header-anchor" href="#概述-1" aria-label="Permalink to &quot;概述&quot;">​</a></h3><p>反正就是在表格里做个单选，然后点确定把选中的数据传出去这么一件事，大概长这样，有些信息有点敏感所以隐藏了 <img src="'+h+'" alt=""></p><p>然后这里也看到了表格第一列的单选居然可以选多个，居然还有如此操作，这不得让咱鉴赏一下代码？看看 HTML 先</p><p><img src="'+p+'" alt=""></p><p>这里鼠鼠我眉头一皱，v-model 可以这样绑定吗，貌似有哪里不对，但又说不出来哪里有问题，嗯..看看确定按钮的逻辑吧</p><p><img src="'+l+'" alt=""></p><p>看起来没啥问题，让我看看这个 addressLine 的来头是什么</p><p><img src="'+m+'" alt=""></p><p><img src="'+c+'" alt=""></p><p>?啊???老哥真就玄学编程啊，难道您在期待 addressLine 能自己变出数据吗?我算是懂了，这项目就是个冤种项目，TMD 功能都没写完就上线？</p>',39),M=[P];function D(Y,g,u,x,d,X){return r(),s("div",null,M)}const G=e(f,[["render",D]]);export{z as __pageData,G as default};
